signal xpm_rst: std_logic_vector(0 downto 0);
signal core_data_out, lat_data_out, dly_data_out: std_logic_vector(width-1 downto 0);

component synth_reg
    generic (
      width: integer;
      latency: integer
    );
    port (
      i: in std_logic_vector(width - 1 downto 0);
      ce: in std_logic;
      clr: in std_logic;
      clk: in std_logic;
      o: out std_logic_vector(width - 1 downto 0)
    );
  end component;

