  reg1: synth_reg
    generic map (
    width => width,
    latency => latency - 2
    )
    port map (
    i => core_data_out,
    ce => a_en(0),
    clr => '0',
    clk => clk,
    o => lat_data_out
    );
  reg2: synth_reg_w_init
    generic map (width      => width,
    init_index => 2,
    init_value => init_value,
    latency    => 1)
    port map (i   => lat_data_out,
    ce  => a_en(0),
    clr => a_rst(0),
    clk => clk,
    o   => dly_data_out);
  end generate;

  latency_2 : if (latency = 2) generate
  reg3: synth_reg_w_init
    generic map (width      => width,
    init_index => 2,
    init_value => init_value,
    latency    => 1)
    port map (i   => core_data_out,
    ce  => a_en(0),
    clr => a_rst(0),
    clk => clk,
    o   => dly_data_out);
  end generate;

  latency_1 : if (latency<=1) generate
  dly_data_out <= core_data_out;
  end generate;
